"use strict";(self.webpackChunkjobscripts_site=self.webpackChunkjobscripts_site||[]).push([[8130],{7735:a=>{a.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"acesso-asura-palace-mirror-kaldrox","metadata":{"permalink":"/blog/acesso-asura-palace-mirror-kaldrox","source":"@site/blog/2025-07-04-acesso-asura-palace-mirror-kaldrox.mdx","title":"Acesso Asura Valts","description":"- Esse post segue um artigo do TibiaWiki, para adquirir acesso ao Asura Valts (Espelho) do Asura Palace.","date":"2025-07-04T00:00:00.000Z","tags":[{"inline":false,"label":"Tibia","permalink":"/blog/tags/tibia","description":"Posts relacionados ao Tibia."},{"inline":false,"label":"Kaldrox","permalink":"/blog/tags/kaldrox","description":"Posts do Kaldrox Global."}],"readingTime":3.38,"hasTruncateMarker":true,"authors":[{"name":"JOB Scripts","title":"O scripter","url":"https://jobscripts.com.br","page":{"permalink":"/blog/authors/all-jobscripts/"},"socials":{"instagram":"https://www.instagram.com/jobscripts"},"imageURL":"/img/jobscripts.jpg","key":"jobscripts"}],"frontMatter":{"slug":"acesso-asura-palace-mirror-kaldrox","title":"Acesso Asura Valts","authors":"jobscripts","tags":["tibia","kaldrox"]},"unlisted":false,"nextItem":{"title":"Como separar as hotkeys no Tibia Client 8.6","permalink":"/blog/como-separar-as-hotkeys-no-tibia-8-6"}},"content":"- Esse post segue um [artigo do TibiaWiki](https://www.tibiawiki.com.br/index.php?title=The_Lost_Brother_Quest&oldid=303318#32926,32680,7:4), para adquirir acesso ao [Asura Valts](https://www.tibiawiki.com.br/wiki/Asura_Vaults) (Espelho) do Asura Palace.\\n- Essa miss\xe3o ir\xe1 funcionar no [Kaldrox Global](https://www.kaldrox.com/?subtopic=Quests).\\n\x3c!--truncate--\x3e\\n## Iniciando a miss\xe3o\\nPara iniciar a quest, voc\xea precisar\xe1 viajar a **Port Hope**. Siga a dire\xe7\xe3o nordeste, como aponta a imagem, e voc\xea chegar\xe1 em Kha\'zeel Mountains, onde encontrar\xe1 o **NPC Tarun**.\\n<details>\\n  <summary>\\n    <p>Localiza\xe7\xe3o do NPC Tarun</p>\\n  </summary>\\n  ![Localiza\xe7\xe3o do NPC Tarun](/img/asuramirror/tarun.png)\\n  </details>\\n:::tip\\nVoc\xea poder\xe1 chegar mais r\xe1pido usando a canoa de Lorek, para isso basta pedir uma passagem para *mountain pass*.\\n\\n**Di\xe1logo**:\\n```\\n- Lorek: Welcome, JobScripts! I have been expecting you.\\n- JOB Scripts: mountain pass\\n- Lorek: Do you want to sail to Mountain of Port Hope ?\\n- JOB Scripts: yes\\n```\\n<details>\\n  <summary>\\n    <p>Localiza\xe7\xe3o do Lorek</p>\\n  </summary>\\n  ![Localiza\xe7\xe3o do NPC Lorek](/img/asuramirror/lorek.png)\\n  </details>\\n:::\\n  **Di\xe1logo**:\\n```\\n- JOB Scripts: hi\\n- Tarun: Greetings!\\n- Tarun: Here\'s my offer, JobScripts. Don\'t you like it?\\n- JOB Scripts: mission\\n- Tarun: My brother is missing. I fear, he went to this evil palace north of here. A place of great beauty, certainly filled with riches and luxury. But in truth it is a threshold to hell and demonesses are after his blood. He is my brother, and I am deeply ashamed to admit but I don\'t dare to go there. Perhaps your heart is more courageous than mine. Would you go to see this place and search for my brother?\\n- JOB Scripts: yes\\n- Tarun: I thank you! This is more than I could hope!\\n```\\n![Caminho Port Hope](/img/asuramirror/porthope.png)\\n\\n## Os Calabou\xe7os Secretos\\n\\nCaminhe para o noroeste do NPC e voc\xea logo encontrar\xe1 o Asura Palace.\\nSua miss\xe3o dever\xe1 ser enfrentar a boss *The Flaming Orchid*, mas para isso voc\xea dever\xe1 enfrentar algumas criaturas como *Destroyers*, *Hydras* e *Liches* que est\xe3o localizadas em calabou\xe7os secretos dentro do pal\xe1cio, basta matar todas dentro dos calabou\xe7os. Caso Algu\xe9m j\xe1 tenha as derrotado, voc\xea pode esperar que elas nas\xe7am novamente.\\n\\nA medida que voc\xea for explorando o pal\xe1cio encontrar\xe1 rachaduras em alguns SQMs, ao andar sobre essas rachaduras voc\xea cair\xe1 dentro dos calabou\xe7os secretos e para sair deles bastar usar uma rope ou a exani tera.\\n\\n### Sala dos Liches\\n<details>\\n  <summary>\\n    <p>Localiza\xe7\xe3o do calabou\xe7o dos liches</p>\\n  </summary>\\n  ![Localiza\xe7\xe3o do calabou\xe7o dos liches (Minimap)](/img/asuramirror/lich.png)\\n  ![Localiza\xe7\xe3o do calabou\xe7o dos liches](/img/asuramirror/lich1.png)\\n  </details>\\n\\n### Sala das Hydras\\n<details>\\n  <summary>\\n    <p>Localiza\xe7\xe3o do calabou\xe7o das hydras</p>\\n  </summary>\\n  ![Localiza\xe7\xe3o do calabou\xe7o das hydras (Minimap)](/img/asuramirror/hydra.png)\\n  ![Localiza\xe7\xe3o do calabou\xe7o das hydras](/img/asuramirror/hydra1.png)\\n  </details>\\n\\n### Sala dos Destroyers\\n<details>\\n  <summary>\\n    <p>Localiza\xe7\xe3o do calabou\xe7o dos destroyers</p>\\n  </summary>\\n  ![Localiza\xe7\xe3o do calabou\xe7o dos destroyers (Minimap)](/img/asuramirror/destroyer.png)\\n  ![Localiza\xe7\xe3o do calabou\xe7o dos destroyers](/img/asuramirror/destroyer1.png)\\n  </details>\\n\\n### Sala dos Massive Fire Elementals\\n<details>\\n  <summary>\\n    <p>Localiza\xe7\xe3o do calabou\xe7o dos fire elementals</p>\\n  </summary>\\n  ![Localiza\xe7\xe3o do calabou\xe7o dos fire elementals (Minimap)](/img/asuramirror/fireelemental.png)\\n  ![Localiza\xe7\xe3o do calabou\xe7o dos fire elementals](/img/asuramirror/fireelemental1.png)\\n  </details>\\n\\n### Sala dos Massive Energy Elementals\\n<details>\\n  <summary>\\n    <p>Localiza\xe7\xe3o do calabou\xe7o energy elementals</p>\\n  </summary>\\n  ![Localiza\xe7\xe3o do calabou\xe7o energy elementals (Minimap)](/img/asuramirror/energyelemental.png)\\n  ![Localiza\xe7\xe3o do calabou\xe7o energy elementals](/img/asuramirror/energyelemental1.png)\\n  </details>\\n\\n### The Flaming Orchid\\n<details>\\n  <summary>\\n    <p>Localiza\xe7\xe3o da Flaming Orchid</p>\\n  </summary>\\n  ![Localiza\xe7\xe3o da Flaming Orchid (Minimap)](/img/asuramirror/asura.png)\\n  ![Localiza\xe7\xe3o da Flaming Orchid](/img/asuramirror/asura1.png)\\n  </details>\\n\\n## Finalizando a miss\xe3o\\nVolte ao NPC Tarun e reporte a miss\xe3o.\\n\\n**Di\xe1logo**:\\n```\\n- JOB Scripts: hi\\n- Tarun: Greetings!\\n- JOB Scripts: mission\\n- Tarun: So, he is dead as I feared. I warned him to go with this woman, but he gave in to temptation. My heart darkens and moans. But you have my sincere thanks. Without your help I would have stayed in the dark about his fate. Please, take this as a little recompense. \\n```\\nAo finalizar a miss\xe3o voc\xea ganhar\xe1 acesso ao [Asura Valts](https://www.tibiawiki.com.br/wiki/Asura_Vaults) por tr\xe1s do espelho localizado no andar t\xe9rreo do pal\xe1cio.\\n\\n![Localiza\xe7\xe3o do Asura Vaults](/img/asuramirror/mirror.png)"},{"id":"como-separar-as-hotkeys-no-tibia-8-6","metadata":{"permalink":"/blog/como-separar-as-hotkeys-no-tibia-8-6","source":"@site/blog/2025-07-04-como-separar-as-hotkeys-no-tibia-8-6.mdx","title":"Como separar as hotkeys no Tibia Client 8.6","description":"Neste v\xeddeo estarei ensinando a separar as hotkeys nos seus clientes de tibia 8.6. Muito \xfatil para facilitar sua vida durante a jogatina!","date":"2025-07-04T00:00:00.000Z","tags":[{"inline":false,"label":"Tibia","permalink":"/blog/tags/tibia","description":"Posts relacionados ao Tibia."}],"readingTime":0.38,"hasTruncateMarker":true,"authors":[{"name":"JOB Scripts","title":"O scripter","url":"https://jobscripts.com.br","page":{"permalink":"/blog/authors/all-jobscripts/"},"socials":{"instagram":"https://www.instagram.com/jobscripts"},"imageURL":"/img/jobscripts.jpg","key":"jobscripts"}],"frontMatter":{"slug":"como-separar-as-hotkeys-no-tibia-8-6","title":"Como separar as hotkeys no Tibia Client 8.6","authors":"jobscripts","tags":["tibia"]},"unlisted":false,"prevItem":{"title":"Acesso Asura Valts","permalink":"/blog/acesso-asura-palace-mirror-kaldrox"}},"content":"Neste v\xeddeo estarei ensinando a separar as hotkeys nos seus clientes de **tibia 8.6**. Muito \xfatil para facilitar sua vida durante a jogatina!\\n\x3c!--truncate--\x3e\\n<iframe width=\\"100%\\" height=\\"500\\" src=\\"https://www.youtube.com/embed/zGjMI8fdmyE?si=FdJLGoqvortb4lcg\\" title=\\"YouTube video player\\" frameborder=\\"0\\" allow=\\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\\" referrerpolicy=\\"strict-origin-when-cross-origin\\" allowfullscreen></iframe>\\n\\n## Links utilizados no Post:\\n1. [Download do Notepad++](https://notepad-plus-plus.org/downloads/)"}]}}')}}]);